import NavBar from './NavBar';
import Home from './Home';

function Welcome(props) {
  return <h1>Hello, {props.name}</h1>;
}

function App() {
  return (
    <div className="App">
      <Welcome props="Hello"/>
      <div className="content">
        <Home />
      </div>
    </div>
  );
}

export default App;
